import React from 'react'
import Logo from '../Assets/bolt_logo.png'

const Main = () => {
  return (
    <div className='logo'>
        <img src={Logo} alt='logo'/>
        <button onclick="activateLasers()">
  Activate Lasers
</button>
    </div>

  )
}

export default Main
